import React from 'react';

const FlagCo = props => (
  <svg viewBox="0 0 6 4" {...props}>
    <path fill="#CE1126" d="M0 0h6v4H0z" />
    <path fill="#003893" d="M0 0h6v3H0z" />
    <path fill="#FCD116" d="M0 0h6v2H0z" />
  </svg>
);

export default FlagCo;
